import React, { Component } from 'react'; 
import './index.css';

export default class YourForest extends Component {
    render() {
        return(
            <div>
                <div className="menu-item">
                    <section className="menu-functionality">
                        <h1 className="centered">Your Forest</h1>
                        <hr aria-hidden="true"/>
                        <p>Tree Type: <strong class="streaks centered">Ordinary Tree</strong></p>
                        <button type="button" id="plantTree" className="forest-btn" aria-label="Plant a tree" role="button">Grow a Tree</button>

                        <p>Flower Type: <strong class="streaks centered">Rainbow Roses</strong></p>
                        <button type="button" id="plantFlower" className="forest-btn text-center" aria-label="Plant a flower" role="button">Grow a Flower</button>
                    </section>
                </div>
            </div>
        );
    }

}
